window.bookSummaryJSON = "<p><b>The Formorians, led by the gigantic Queens, have breached humanity's last line of defense.</b></p> <p>Elaine – now Sentinel Dawn – and the rest of the Sentinels need to rush to the front lines to attempt to stabilize the situation and bring the 2500-year long war against the Formorians to a grand finale.</p> <p>And yet, beyond them lurks an even greater danger.</p> <p>What could've possibly driven the Formorian Queens and Royal Guards out of their lairs, into human territory? Will Elaine and the Sentinels have to pay a terrible price to save humanity? Or will civilization be smashed, and humans scattered to the winds? And what, exactly, are the Dragoneye Moons?</p>"; 
